static Optional<u32> index_of_code_point_in_range(u32 code_point)
{
    if ((code_point > 0x3400) && (code_point < 0x4dbf))
        return 12139;
    if ((code_point > 0x4e00) && (code_point < 0x9ffc))
        return 12205;
    if ((code_point > 0xac00) && (code_point < 0xd7a3))
        return 15070;
    if ((code_point > 0xd800) && (code_point < 0xdb7f))
        return 15144;
    if ((code_point > 0xdb80) && (code_point < 0xdbff))
        return 15146;
    if ((code_point > 0xdc00) && (code_point < 0xdfff))
        return 15148;
    if ((code_point > 0xe000) && (code_point < 0xf8ff))
        return 15150;
    if ((code_point > 0x17000) && (code_point < 0x187f7))
        return 25247;
    if ((code_point > 0x18d00) && (code_point < 0x18d08))
        return 26487;
    if ((code_point > 0x20000) && (code_point < 0x2a6dd))
        return 32902;
    if ((code_point > 0x2a700) && (code_point < 0x2b734))
        return 32904;
    if ((code_point > 0x2b740) && (code_point < 0x2b81d))
        return 32906;
    if ((code_point > 0x2b820) && (code_point < 0x2cea1))
        return 32908;
    if ((code_point > 0x2ceb0) && (code_point < 0x2ebe0))
        return 32910;
    if ((code_point > 0x30000) && (code_point < 0x3134a))
        return 33454;
    if ((code_point > 0xf0000) && (code_point < 0xffffd))
        return 33793;
    if ((code_point > 0x100000) && (code_point < 0x10fffd))
        return 33795;
    return {};
}

Optional<UnicodeData> unicode_data_for_code_point(u32 code_point)
{
    VERIFY(is_unicode(code_point));

    if (code_point <= 0x377)
        return s_unicode_data[code_point];

    if (auto index = index_of_code_point_in_range(code_point); index.has_value()) {
        auto data_for_range = s_unicode_data[*index];
        data_for_range.simple_uppercase_mapping = code_point;
        data_for_range.simple_lowercase_mapping = code_point;
        return data_for_range;
    }

    auto it = AK::find_if(s_unicode_data.begin(), s_unicode_data.end(), [code_point](auto const& data) { return data.code_point == code_point; });
    if (it != s_unicode_data.end())
        return *it;

    return {};
}

